import React from "react";
import ReactDOM from "react-dom/client";
import { Helmet } from "react-helmet";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./style.css";
import Frame1 from "./views/frame1";
import NotFound from "./views/not-found";
import Reg from "./views/reg";
import Login from "./views/login";
import Meat from "./views/meat";
import Ml from "./views/ml";
import Frame2 from "./views/frame2";
const App = () => {
  const [predictionData, setPredictionData] = useState(null);

  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Frame1 setPredictionData={setPredictionData} />
        </Route>
        <Route exact path="/ml">
          <MlPage predictionData={predictionData} />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <>
    <Helmet>
      <title>Fast Cooking</title>
      <link rel="icon" href="star17.svg" type="image/x-icon" />
      <style>@import url('https://fonts.cdnfonts.com/css/days-one');</style>
      <script
        src="https://kit.fontawesome.com/9b617fddaa.js"
        crossOrigin="anonymous"
      ></script>
    </Helmet>
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<Frame1 />} />
          <Route path="/reg" element={<Reg />} />
          <Route path="/login" element={<Login />} />
          <Route path="/meat" element={<Meat />} />
          <Route path="**" element={<NotFound />} />
          <Route path="/frame2" element={<Frame2 />} />
        </Routes>
      </div>
    </Router>
  </>
);
